import React, { useState } from 'react';
import './Header.css';

const Header = () => {
  const [selectedCountry, setSelectedCountry] = useState('US');
  const [selectedLanguage, setSelectedLanguage] = useState('English');
  const [selectedCurrency, setSelectedCurrency] = useState('USD');

  const countries = [
    { value: 'US', label: 'United States' },
    { value: 'UK', label: 'United Kingdom' },
    { value: 'CA', label: 'Canada' },
    { value: 'AU', label: 'Australia' },
    { value: 'DE', label: 'Germany' },
    { value: 'FR', label: 'France' },
  ];

  const languages = [
    { value: 'English', label: 'English' },
    { value: 'Spanish', label: 'Español' },
    { value: 'French', label: 'Français' },
    { value: 'German', label: 'Deutsch' },
    { value: 'Italian', label: 'Italiano' },
  ];

  const currencies = [
    { value: 'USD', label: 'USD ($)' },
    { value: 'EUR', label: 'EUR (€)' },
    { value: 'GBP', label: 'GBP (£)' },
    { value: 'JPY', label: 'JPY (¥)' },
    { value: 'CAD', label: 'CAD (C$)' },
  ];

  return (
    <header className="header">
      <div className="header-container">
        <div className="logo-container">
          <div className="logo">
            <svg width="50" height="50" viewBox="0 0 50 50" fill="none" xmlns="http://www.w3.org/2000/svg">
              {/* Compass/Globe Logo for Travel */}
              <circle cx="25" cy="25" r="22" fill="url(#gradient1)" stroke="#4A90E2" strokeWidth="2"/>
              {/* Compass needle pointing North */}
              <line x1="25" y1="8" x2="25" y2="18" stroke="#FF6B35" strokeWidth="3" strokeLinecap="round"/>
              <line x1="25" y1="32" x2="25" y2="42" stroke="#4A90E2" strokeWidth="3" strokeLinecap="round"/>
              {/* Compass cross */}
              <line x1="10" y1="25" x2="20" y2="25" stroke="#333" strokeWidth="2" strokeLinecap="round"/>
              <line x1="30" y1="25" x2="40" y2="25" stroke="#333" strokeWidth="2" strokeLinecap="round"/>
              {/* Airplane icon */}
              <path d="M25 15L20 20L25 22L30 20L25 15Z" fill="#FFD23F"/>
              <path d="M20 20L25 25L30 20" stroke="#FF6B35" strokeWidth="2" fill="none"/>
              {/* World map lines */}
              <path d="M15 20 Q20 18 25 20 Q30 18 35 20" stroke="#4A90E2" strokeWidth="1.5" fill="none" opacity="0.6"/>
              <path d="M15 30 Q20 32 25 30 Q30 32 35 30" stroke="#4A90E2" strokeWidth="1.5" fill="none" opacity="0.6"/>
              <defs>
                <linearGradient id="gradient1" x1="0%" y1="0%" x2="100%" y2="100%">
                  <stop offset="0%" stopColor="#4A90E2" stopOpacity="1" />
                  <stop offset="100%" stopColor="#357ABD" stopOpacity="1" />
                </linearGradient>
              </defs>
            </svg>
          </div>
        </div>

        <div className="header-right">
          <div className="dropdown-group">
            <select 
              className="dropdown" 
              value={selectedCountry}
              onChange={(e) => setSelectedCountry(e.target.value)}
            >
              {countries.map(country => (
                <option key={country.value} value={country.value}>
                  {country.label}
                </option>
              ))}
            </select>

            <select 
              className="dropdown" 
              value={selectedLanguage}
              onChange={(e) => setSelectedLanguage(e.target.value)}
            >
              {languages.map(lang => (
                <option key={lang.value} value={lang.value}>
                  {lang.label}
                </option>
              ))}
            </select>

            <select 
              className="dropdown" 
              value={selectedCurrency}
              onChange={(e) => setSelectedCurrency(e.target.value)}
            >
              {currencies.map(currency => (
                <option key={currency.value} value={currency.value}>
                  {currency.label}
                </option>
              ))}
            </select>
          </div>

          <div className="auth-buttons">
            <button className="btn-login">Login</button>
            <button className="btn-signup">Create Account</button>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
